<script>
import Socket from '../scripts/Socket'

export default {
  data() {
    return {
      parkingSpots: {}
    }
  },
  methods: {
    updateParkingSpots(msg) {
      let iotdata = JSON.parse(msg).IotData
      this.parkingSpots = iotdata
    }
  },
  created() {
    Socket.$on('message', this.updateParkingSpots)
  },
  beforeDestroy() {
    Socket.$off('message', this.updateParkingSpots)
  }
}
</script>

